import axios from 'axios';
import * as Actions from '../actions';



export const addTodo = ({ title, userId }) => {
    return dispatch => {

      axios
      .get("http://localhost:5000/teamMembers")
        .then(res => {
          dispatch(Actions.changeTMList(res.data));
        })
        .catch(err => {
          dispatch(addTodoFailure(err.message));
        });
    };
  };


